import React, { Component } from "react";
import Sidebar from "./Sidebar";
import "../styles/main.css";
import About from "./About";
import Experience from "./Experience";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Sidebar />
        <div className="main">
          <About />
          <Experience />
        </div>
      </div>
    );
  }
}

export default App;
